import React, { Component } from "react";
import { connect } from "react-redux";
import { getClients } from "../src/Actions/ClientActions";
import PropTypes from "prop-types";
import Clientitem from "./Actions/Clientitem";
import { Link } from "react-router-dom";
import {
  CBadge,
  CCard,
  CCardBody,
  CCardHeader,
  CCol,
  CDataTable,
  CRow,
} from "@coreui/react";

const styleBackground = {
  backgroundColor: "#34495e",
};
const fields = ["name", "registered", "role", "status"];
class Tables extends Component {
  componentDidMount() {
    this.props.getClients();
  }

  render() {
    const { clients } = this.props.client;
    return (
      <div className="content-wrapper">
        <div className="container">
          <div className="projects">
            <div className="container">
              <div className="row">
                <div className="col-md-12">
                  <h1 className="display-4 text-center">Clients</h1>
                  <br />
                  <Link
                    to="addclient"
                    className="btn btn-lg btn-info float-right mb-2"
                  >
                    Add Client
                  </Link>
                  <CRow>
                    <CCol xs="18" lg="12">
                      <CCard>
                        <CCardHeader>
                          Listes des clients
                          <DocsLink name="CModal" />
                        </CCardHeader>
                        <CCardBody>
                          <CDataTable
                            items={Clientitem}
                            fields={fields}
                            itemsPerPage={5}
                            pagination
                          />
                        </CCardBody>
                      </CCard>
                    </CCol>
                  </CRow>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
Tables.propTypes = {
  client: PropTypes.object.isRequired,
  getClients: PropTypes.func.isRequired,
};

const mapStateToProps = (state) => ({
  client: state.client,
});

export default connect(mapStateToProps, { getClients })(Tables);
